export default reducer = (posts = [], action) => {
    switch(action.type){
        case 'FETCH_ALL':
            return action.payload;
        case 'CREATE':
            console.log("THIS EXECUTED");
            return [...posts, action.payload];
        default:
            return posts;
    }
}
